INSERT INTO `bc73q_modules` VALUES(221, 696, 'Kontaktujte nás', '', '<script type=\"application/ld+json\">{\"@context\" : \"http://schema.org\",\"@type\" : \"LocalBusiness\",\"name\" : \"KINISI centrum fyzioterapie\",\"telephone\" : \"+420 725 300 254\",\"address\": {\"@type\": \"PostalAddress\",\"streetAddress\" : \"Plkovská 1\",\"addressLocality\" : \"Praha 9 – Horní Počernice\",\"addressRegion\" : \"Česká republika\",\"postalCode\" : \"19300\"},\"description\" : \"Kinisi centrum fyzioterapie v Praze - Horních Počernicích spojuje profesionální přístup zkušených fyzioterapeutů se špičkovým moderním vybavením. Fyzioterapeuti Kinisi pomáhají svým klientům zbavit se akutních i chronických obtíží pohybového systému s využitím aktuálních vědeckých poznatků, nejmodernějších metod fyzioterapie a zkušeností.\",\"url\" : \"https://kinisi.cz\", \"image\" : \"https://kinisi.cz/images/kinisi-spol.jpg\", \"logo\" : \"https://kinisi.cz/images/6logo_kinisi_final.png\",\"openingHours\": \"Mo,Tu,We 07:00-20:00 Th 07:00-15:00\",\"sameAs\": [\"https://www.facebook.com/Kinisiphysio\",\"https://www.instagram.com\"]}</script>\r\n<p><i class=\"fa fa-phone\"></i><a href=\"tel:+420725300254\">+420 725 300 254</a></p>\r\n\r\n<p><i class=\"fa fa-envelope-o\"></i><a href=\"mailto:info@kinisi.cz\">info@kinisi.cz</a></p>\r\n\r\n<p><i class=\"fa fa-map-marker\"></i><span>Plkovská 1 (budova B), Praha 9 – Horní Počernice, 193 00 Spojení MHD: Zastávka bus „Na Kovárně“ (10 minut od metra B Černý most)</span></p>\r\n', 3, 'bottom', 0, '0000-00-00 00:00:00', '2017-10-24 11:49:01', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":\"1\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"bottom_contact\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"3\",\"bootstrap_offset\":\"0\",\"header_tag\":\"h6\",\"header_class\":\"heading-style-8\",\"style\":\"0\"}', 0, '*');
