INSERT INTO `bc73q_modules` VALUES(274, 792, 'Průběh fyzioterapie', '', '<h6 style=\"text-align: center;\"><strong>Není potřeba žádné doporučení od lékaře</strong></h6>\r\n\r\n<p style=\"text-align: center;\">Kinisi je soukromé fyzioterapeutické centrum. Můžete se na nás obrátit přímo i bez doporučení od lékaře. Všechny služby plně hrazené klientem v hotovosti.</p>\r\n\r\n<h6 style=\"text-align: center;\"><i class=\"fa fa-dot-circle-o\"></i>&nbsp;<strong> První schůzka</strong></h6>\r\n\r\n<p style=\"text-align: center;\">Na první schůzku se prosím dostavte 10 minut před smluveným termínem. Je vhodné si sebou přinést zdravotnickou dokumentaci již absolvovaných vyšetření a zákroků. Během první terapie probereme detailně historii vašeho zdravotního stavu. Poté zhodnotíme funkci vašeho pohybového systému, rozsah pohybu, sílu a provedeme kompletní diagnostické testy. Vaše diagnóza vám bude vysvětlena a bude vám doporučen plán řešení vašich obtíží.</p>\r\n\r\n<h6 style=\"text-align: center;\"><i class=\"fa fa-dot-circle-o\"></i>&nbsp;<strong> Aktivní účast</strong></h6>\r\n\r\n<p style=\"text-align: center;\">V našem fyzioterapeitickém centru jste aktivním účastníkem vaší rehabilitace. Vás fyzioterapeut disponuje mnoha technikami řešení vašich obtíží přímo v centru, vaše domácí aktivita je ale rovněž velmi důležitá. Váš plán bude obsahovat doporučené cviky, které přispějí k rychlejšímu dosažení výsledků.</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n', 9, 'accordeon_up', 0, '0000-00-00 00:00:00', '2017-10-24 11:49:01', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{\"prepare_content\":\"1\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"bottom_contact2\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"12\",\"bootstrap_offset\":\"0\",\"header_tag\":\"h6\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*');
INSERT INTO `bc73q_modules` VALUES(275, 793, 'Hledáte (kopie)  dolu', 'puvodne bylo counter_home center', '<h3>prvotřídníHO fyzioterapeuta v Praze?</h3>\r\n\r\n<p>Ve Fyzioterapeutickém centru Kinisi najdete vysoce kvalifikovanou osobní péči erudovaných a zkušených fyzioterapeutů.</p>\r\n\r\n<ul class=\"buttons\">\r\n	<li><a href=\"https://services.bookio.com/kinisi-centrum-fyzioterapie/widget?lang=cs\">Objednat se online</a></li>\r\n	<li><span>nebo</span></li>\r\n	<li><a href=\"index.php/pages/portfolio\">Prohlédnout si služby</a></li>\r\n</ul>\r\n', 1, 'mainbottom', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 0, '{\"prepare_content\":\"1\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"callback\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"12\",\"bootstrap_offset\":\"0\",\"header_tag\":\"h6\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*');
